import React, { useEffect, useState } from "react";

import Default_Info from './Default_Info.js'
import { Route, Routes, useParams } from "react-router-dom";

export const GetDetails_integrator = () => {

    let params = useParams();
    const [PlaceId, updatePlaceId] = useState('')

    useEffect(()=>{
        updatePlaceId(params.placeid)
    },[params])

    return <React.Fragment>
    
        <Routes>
            <Route 
            path="/:placeid"
            element={<Default_Info place_id={PlaceId}/>}>
            </Route>
        </Routes>

        </React.Fragment>
}

export default GetDetails_integrator
